#include "../matrix_lib/matrix_lib.h"
#include <gtest/gtest.h>

TEST(TestMinus, basic) {
    matrix_lib::Matrix left;
    matrix_lib::Matrix result;
    left = matrix_lib::Matrix{{-25, 3},
                              {39,  14}};
    result = matrix_lib::Matrix{{25,  -3},
                                {-39, -14}};
    EXPECT_EQ(-left, result);

    left = matrix_lib::Matrix{{-31, -43},
                              {34,  33}};
    result = matrix_lib::Matrix{{31,  43},
                                {-34, -33}};
    EXPECT_EQ(-left, result);

    left = matrix_lib::Matrix{{50, 36},
                              {-3, 38}};
    result = matrix_lib::Matrix{{-50, -36},
                                {3,   -38}};
    EXPECT_EQ(-left, result);

    left = matrix_lib::Matrix{{-29, 36},
                              {35,  -2}};
    result = matrix_lib::Matrix{{29,  -36},
                                {-35, 2}};
    EXPECT_EQ(-left, result);

    left = matrix_lib::Matrix{{9,  -26},
                              {-6, -39}};
    result = matrix_lib::Matrix{{-9, 26},
                                {6,  39}};
    EXPECT_EQ(-left, result);

    left = matrix_lib::Matrix{{-43, -14},
                              {-29, -36}};
    result = matrix_lib::Matrix{{43, 14},
                                {29, 36}};
    EXPECT_EQ(-left, result);

    left = matrix_lib::Matrix{{35, 26},
                              {15, 37}};
    result = matrix_lib::Matrix{{-35, -26},
                                {-15, -37}};
    EXPECT_EQ(-left, result);

    left = matrix_lib::Matrix{{-28, 16},
                              {-25, -46}};
    result = matrix_lib::Matrix{{28, -16},
                                {25, 46}};
    EXPECT_EQ(-left, result);

    left = matrix_lib::Matrix{{42, 4},
                              {19, 41}};
    result = matrix_lib::Matrix{{-42, -4},
                                {-19, -41}};
    EXPECT_EQ(-left, result);

    left = matrix_lib::Matrix{{0,   5},
                              {-21, -8}};
    result = matrix_lib::Matrix{{0,  -5},
                                {21, 8}};
    EXPECT_EQ(-left, result);
}

